      when(l_imp_type === lit(7), l_net_media_cost_dollar_cpm)
        .otherwise(lit(0.0))
        .as("net_media_cost_dollar_cpm"),
      l_media_cost_dollars_cpm.as("media_cost_dollar_cpm"),
      l_buyer_transacted.as("buyer_transacted"),
      l_seller_transacted.as("seller_transacted"),
      is_buy_side_imp.as("is_buy_side_imp"),
      is_sell_side_imp.as("is_sell_side_imp"),
      lit(null).as("buyer_member_pricing_term"),
      lit(null).as("seller_member_pricing_term")
    )
    co
  }

